import React from 'react';
import classes from '../../css/Dialogues/Dialogues.module.css';
import {NavLink} from 'react-router-dom';

const DialogueItem = (props) => {
    return (
        <div className={classes.dialogue}>
            <NavLink to={'/messages/' + props.id}>
                {props.name}
            </NavLink>
        </div>
    );
}

const Message = (props) => {
    return <div className={classes.message}>{props.message}</div>
}

const Dialogues = (props) => {

    let dialoguesData = [
        {id: 1, name: 'Мария'},
        {id: 2, name: 'Антон'},
        {id: 3, name: 'Мария'},
        {id: 4, name: 'Мария'},
        {id: 5, name: 'Мария'},
    ]

    return (
        <div className={classes.dialogues}>
            <div className={classes.dialogues_items}>
                <DialogueItem name='Мария' id='1' />
                <DialogueItem name='Антон' id='2' />
                <DialogueItem name='Мартин' id='3' />
                <DialogueItem name='Алексей' id='4' />
                <DialogueItem name='Евгения' id='5' />
            </div>
            <div className={classes.messages}>
                <Message message='Hi!' />
                <Message message='How r u?' />
                <Message message='OK. And u?' />
            </div>
        </div>
    );
}

export default Dialogues;
